public class Solution
{
    public int NumSub(string s)
    {
        int MOD = 1_000_000_007;
        long ones = 0;
        long ans = 0;
        foreach (char c in s)
        {
            if (c == '1')
            {
                ones++;
            }
            else
            {
                if (ones > 0)
                {
                    ans += ones * (ones + 1) / 2;
                    ans %= MOD;
                    ones = 0;
                }
            }
        }
        ans += ones * (ones + 1) / 2;
        ans %= MOD;
        return (int)ans;
    }

    public static void Main()
    {
        var sln = new Solution();
        sln.NumSub("");
    }
}